import React from "react";

function Card({key, timeOfDay, day, temp, cloudType, clouds, high, low}){
    var weatherIcon;

    // Assign weather icon depending on time of day and cloud type
    if(timeOfDay){
        switch(cloudType){
            case "Thunderstorm":
                weatherIcon = "icons/thunderstorm-day.png";
                break;
            case "Drizzle":
                weatherIcon = "icons/drizzle-day.png";
                break;
            case "Rain":
                weatherIcon = "icons/rain-day.png";
                break;
            case "Snow":
                weatherIcon = "icons/snow-day.png";
                break;
            case "Clear":
                weatherIcon = "icons/clear-day.png";
                break;
            case "Clouds":
                weatherIcon = "icons/cloudy-day.png";
                break;
            default:
                weatherIcon = "icons/fog-day.png";
        }
    }
    else{
        switch(cloudType){
            case "Thunderstorm":
                weatherIcon = "icons/thunderstorm-night.png";
                break;
            case "Drizzle":
                weatherIcon = "icons/drizzle-night.png";
                break;
            case "Rain":
                weatherIcon = "icons/rain-night.png";
                break;
            case "Snow":
                weatherIcon = "icons/snow-night.png";
                break;
            case "Clear":
                weatherIcon = "icons/clear-night.png";
                break;
            case "Clouds":
                weatherIcon = "icons/cloudy-night.png";
                break;
            default:
                weatherIcon = "icons/fog-night.png";
        }
    }
    return(
        <div className="card">
            <h3 className="day">{day}</h3>

            <div className="temp-cloud-container">
                <h1 className="temp">{Math.round(temp)}&deg;</h1>
                <img className="cloud-icon" src={require(weatherIcon)} alt="weather-icon"/>
            </div>

            <div className="info-container">
                <p className="clouds">{clouds}</p>

                <div className="high-low">
                    <div>
                        <p>High</p>
                        <p>{Math.round(high)}</p>
                    </div>
                    <div>
                        <p>Low</p>
                        <p>{Math.round(low)}</p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Card;
